import React, { useRef } from "react";

import Card from "../UI/Card/Card";
import classes from "./Home.module.css";

const Home = (props) => {
  const uName = useRef(props.userName);
  return (
    <Card className={classes.home}>
      <h1>Welcome back {uName}!</h1>
    </Card>
  );
};

export default Home;
